import React from "react";
import icon from '../../../assets/icon.svg'
import {faConciergeBell, faStar, faEnvelope} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";



class Head extends React.Component {
  render() {
    return (
      <div className="menu-head" >
        <img src={icon} alt="restaurant logo" height="50" width="50" />
       <div className="menu-head-content"></div>
        
        <div className="menu-links" >
            <a href="#"> <FontAwesomeIcon icon={faEnvelope} /> Message Restaurant</a>
            <a href="#">Visit site</a>
        </div>
      </div>
    );
  }
}

export default Head;
